{ولا تهنوا في ابتغاء القوم إن تكونوا تألمون فإنهم يألمون كما تألمون وترجون من الله ما لا يرجون}
صدق الله العظيم
وما اعظم ان يكون الصراع مع الباطل مشحوناً بمعية الله والتوكل عليه وبالضربات الحيديرية المنكلة التي تجعل الأعداء يصيحون من شدة الوجع من منطلق يعذبهم الله بأيديكم

@Abdul_Algani أمانحن فنعتبر تجاهلكم للاعتداء ع اليمن نذالة وأعتقد أن المملكة تنظر لكم بهذا الشكل وإن أظهرت عكس ذلك لانهم يعلمون أن من يقف ضد بلده ويتظاهر بالحرص ع بلد آخر لايمكن أن يكون صادقا ولا حتى رجلا 
وأما الاعتداء فلا نريده ونحن انما نحارب من يحارب اليمن ونسالم من يسالمها 
